import React, { Component } from 'react'
import axios from 'axios';
import ListGroup from './ListGroup';

class ListMembers extends Component {
    constructor(props) {
        super(props)
        this.state = {members :[]}
    }
    componentDidMount() {
        axios.get(`http://localhost:8092/familytree/member`)
          .then(response => {
            console.log(response.data);
            this.setState({members:response.data})
          }).catch(error =>{
              console.log(error);
          });
      }
      
      render() {
          return (
              <React.Fragment>
                <ul className="list-group">
                  {this.state.members.map(member => (
                  <li className="list-group-item list-group-item-primary"  key={member.id}>
                    {member.id} - {member.firstName}   {member.lastName} a.k.a {member.nickName}
                  </li>
                  ))}
                </ul>
              </React.Fragment>
          );
        }
}

export default ListMembers;
